export default function decodeObject(encoding) {
    const result = {};
    encoding.split('&').forEach((entry) => {
        const [encKey, encValue] = entry.split('=', 2);
        if (encKey != null && encValue != null) {
            result[decodeURIComponent(encKey)] = decodeURIComponent(encValue);
        }
    });
    return result;
}
